function generateFbFeedHTML(a){var e="";a.forEach(function(a){e+='      <div class="flex-item-4 space">      <a href="https://www.facebook.com/events/'+a.id+'/" target="_blank">      <div class="block-style">        <img src="'+a.photo+'" style="max-width: 100%;">        <div class="content-block">        <div class="date">            <span class="day">              '+getMonthName(a.date.month)+'            </span>            <span class="month">              '+a.date.day+'            </span>        </div>        <div class="context">            <span class="title"">              '+a.name+'            </span>            <span class="interval">              '+a.date.timeInterval+"            </span>        </div>        </div>        </div>        </a>      </div>      "}),$(".events-fb").append(e)}function ajaxCall(a,e){$.ajax({url:a,dataType:"json"}).done(function(a){generateFbFeedHTML(a)}).fail(function(a){e(a.statusText)})}function getMonthName(a){return monthNames[a]}jQuery(function(a){ajaxCall("//www.404.md/json/facebook-feed.json",function(){ajaxCall(window.location.origin+"/json/facebook-feed.json",function(a){console.error("Could not load facebook feed: ",a)})}),a(".meeting-room").slick({dots:!1,speed:500,arrows:!0,fade:!0,cssEase:"linear"})});var monthNames=["Jan","Feb","Mar","Apr","May","Jun","Jul","Aug","Sep","Oct","Nov","Dec"];